import React from 'react'

export default function ThakiJa() {
    const containerStyle = {
        position: 'absolute',
        top: '50%',
        left: '50%',
        transform: 'translate(-50%, -50%)'
    }
  return (
    <div>
        <div style={containerStyle}>
           <p></p> Bas Baka Khtam thayi gayu... thaaki ja

            I hope you like this gift and once again Happy Birthday to You...
        </div>
    </div>
  )
}
